import React, {Component} from 'react';
import "../App.css";

export default class Instructions extends Component {
   render() {
       return (
           <div>
               <h3 id="instructionsHeader">Instructions</h3>


               <p id="instructions">Hit the boxes as they approach to earn points! 
                <br></br><br></br>
               Choose whether you would like to play with your mouse or with gesture control.
                <br></br>
               If gesture control doesn't initially seem to be working, try refreshing your page.</p>
           </div>
        );
   }
 }
